// SPDX-License-Identifier: MIT

pragma solidity 0.8.28;

contract Voters {
    struct Voter {
        bool isRegistered;
        bool hasVoted;
        uint votedProposalId;
    }

    struct Proposal {
        string description;
        uint voteCount;
    }

    mapping(address => Voter) public voterList  ;

    mapping(uint => Voter ) public voterProposals;

    struct VoteState {
        Voter _voter;
        Proposal _proposal;
        mapping(address => Voter) _voters;
        mapping(uint => Voter ) _proposals;
    }

    event VoterRegistered(address voterAddress);
    event ProposalRegisterd(uint proposalId);
    event Voted (address voter, uint proposalId);


    function register(address[] calldata voters, VoteState storage _voteState) internal {
        for(uint i; i < voters.length; i++) {
            Voter memory newVoter;
            newVoter.isRegistered = true;
            voterList[voters[i]] = newVoter;
        }
    }

    // function addProposal() {}

    // function vote() {}







}

